app1.controller("UrlCtrl",["$scope","$routeParams","$location","SessionService",function(e,t,n,a){e.sessionData=a.getSessionData();var o=function(){if("undefined"==t.url_iframe||"undefined"==t.application_id)n.url("/applications");else{if(e.sessionData.application_id=t.application_id,e.sessionData.applications){for(var o=e.sessionData.applications,i=0;i<o.length;i++)if(o[i].translated_name=a.translate(o[i].name),o[i].translated_description=a.translate(o[i].description),o[i]._id==t.application_id){e.sessionData.applicationName=o[i].translated_name;break}a.setSessionData(e.sessionData)}document.getElementById("iframe_url").src=t.iframe_url}};e.$watch(function(){return a.getSessionData().applications},function(t,n){t!=n&&(e.sessionData=a.getSessionData(),o())}),o()}]);
